* {
  -webkit-box-sizing: border-box;
  box-sizing: border-box;
  margin: 0;
}

body {
  font-family: "Barlow", sans-serif;
  color: #fff;

  min-height: 100vh;
}

.home-body {
  background: #0e141e url("./images/background-home-desktop.jpg") no-repeat
    center center/cover;
}
.destinations-body {
  background: #0e141e url("./images/background-destination-desktop.jpg")
    no-repeat center center/cover;
}
.header {
  display: -webkit-box;
  display: -ms-flexbox;
  display: flex;
  -webkit-box-pack: end;
  -ms-flex-pack: end;
  justify-content: end;
  -webkit-box-align: center;
  -ms-flex-align: center;
  align-items: center;
  margin-top: 40px;
}

.header hr {
  width: 31vw;
  border-top: 0.01vh solid rgba(255, 255, 255, 0.459);
  border-bottom: none;
  border-left: none;
  border-right: none;
  -webkit-transform: translateX(3vw);
  -ms-transform: translateX(3vw);
  transform: translateX(3vw);
  z-index: 5;
}
.menu-button {
  display: none;
}
nav ul.navigation-list li {
  list-style-type: none;
}
a:link,
a:visited,
a:hover,
a:focus,
a:active {
  text-decoration: none;
  color: inherit;
}
nav ul.navigation-list {
  display: -webkit-box;
  display: -ms-flexbox;
  display: flex;
  -ms-flex-pack: distribute;
  justify-content: space-around;
  -webkit-box-align: center;
  -ms-flex-align: center;
  align-items: center;
  width: 60vw;
  background-color: rgba(255, 255, 255, 0.04);
  -webkit-backdrop-filter: blur(10px);
  backdrop-filter: blur(10px);
}
.navigation-list a {
  font-family: "Barlow Condensed", sans-serif;
  font-size: 16px;
  line-height: 1.5;
  padding: 38px 0 35px 0;
  display: inline-block;
  text-transform: uppercase;
  letter-spacing: 1.5px;
}
.visited-link,
.visited-link:hover {
  border-bottom: 3px solid #fff;
}

.numbers {
  margin-right: 0.3vw;
  font-weight: bold;
}

.section-home {
  margin-top: 30vh;
  margin-left: 12vw;
  padding-bottom: 20vh;
  width: 77vw;
  display: -webkit-box;
  display: -ms-flexbox;
  display: flex;
  -webkit-box-align: end;
  -ms-flex-align: end;
  align-items: flex-end;
  -webkit-box-pack: justify;
  -ms-flex-pack: justify;
  justify-content: space-between;
}
.text-container {
  width: 31vw;
}
h1 {
  font-family: "Bellefair", serif;
  font-weight: 400;
  font-size: 10.4vw;
  line-height: 1.14;
  text-transform: uppercase;
  padding: 1.8vw 0px;
}
h4 {
  font-family: "Bellefair", serif;
  font-weight: 400;
  font-size: 1.8vw;
  line-height: 1.15;
  letter-spacing: 2px;
  text-transform: uppercase;
  color: #0b0d17;
}
h5 {
  font-family: "Barlow Condensed", sans-serif;
  font-weight: 400;
  font-size: 1.8vw;
  line-height: 1.2;
  letter-spacing: 4.72px;
  text-transform: uppercase;
  color: #d0d6f9;
}
p {
  font-family: "Barlow", sans-serif;
  font-weight: 400;
  font-size: 1.3vw;
  line-height: 1.75;
  color: #d0d6f9;
}
a.explore-btn {
  width: 19vw;
  height: 19vw;
  background-color: #fff;
  border-radius: 50%;
  display: -webkit-box;
  display: -ms-flexbox;
  display: flex;
  -webkit-box-pack: center;
  -ms-flex-pack: center;
  justify-content: center;
  -webkit-box-align: center;
  -ms-flex-align: center;
  align-items: center;
  color: black;
  -webkit-transition: -webkit-box-shadow 400ms ease-in-out;
  transition: -webkit-box-shadow 400ms ease-in-out;
  -o-transition: box-shadow 400ms ease-in-out;
  transition: box-shadow 400ms ease-in-out;
  transition: box-shadow 400ms ease-in-out, -webkit-box-shadow 400ms ease-in-out;
}
@media (hover: hover) and (pointer: fine) {
  a.explore-btn:hover {
    -webkit-box-shadow: 0 0 0 5vw rgba(255, 255, 255, 0.1);
    box-shadow: 0 0 0 5vw rgba(255, 255, 255, 0.1);
  }
  .navigation-list a:hover {
    border-bottom: 3px solid rgba(255, 255, 255, 0.5);
  }
}

@media (max-width: 48em) {
  body {
    background: #0e141e url("./images/background-home-tablet.jpg") no-repeat
      center center/cover;
  }
  header {
    margin-top: 0px !important;
  }
  header hr {
    visibility: hidden;
  }
  .header a.logo {
    -webkit-transform: translateX(3.5vw);
    -ms-transform: translateX(3.5vw);
    transform: translateX(3.5vw);
  }
  nav ul.navigation-list {
    width: 75vw;
  }
  .navigation-list a {
    font-size: 14px;
  }
  .numbers {
    display: none;
  }
  .section-home {
    -webkit-box-orient: vertical;
    -webkit-box-direction: normal;
    -ms-flex-direction: column;
    flex-direction: column;
    -webkit-box-align: start;
    -ms-flex-align: start;
    align-items: flex-start;
    gap: 15vh;
    margin-left: 20vw;
    margin-top: 12.1vh;
    width: 58.6vw;
  }
  .text-container {
    width: 100%;
  }
  h1 {
    font-size: 19.5vw;
    line-height: 1;
    padding: 3.1vw 0;
  }
  h4 {
    font-size: 4.2vw;
  }
  p,
  h5 {
    font-size: 2.6vw;
  }
  h5 {
    letter-spacing: 3.38px;
  }

  h5,
  p {
    text-align: center;
  }
  a.explore-btn {
    width: 32vw;
    height: 32vw;
    margin: 0 auto;
  }
}
@media (max-width: 23.44em) {
  .menu-button {
    display: block;
    position: relative;
    z-index: 10;
    width: 24px;
  }
  .header {
    -webkit-box-pack: space-evenly;
    -ms-flex-pack: space-evenly;
    justify-content: space-evenly;
    margin-top: 24px !important;
  }
  .header a.logo {
    -webkit-transform: translateX(-5vw);
    -ms-transform: translateX(-5vw);
    transform: translateX(-5vw);
  }
  .visible {
    -webkit-transform: scale(1) !important;
    -ms-transform: scale(1) !important;
    transform: scale(1) !important;
  }
  nav ul.navigation-list {
    position: absolute;
    top: 0;
    right: 0;
    height: 100vh;
    -webkit-box-orient: vertical;
    -webkit-box-direction: normal;
    -ms-flex-direction: column;
    flex-direction: column;
    -webkit-box-pack: start;
    -ms-flex-pack: start;
    justify-content: start;
    -webkit-box-align: start;
    -ms-flex-align: start;
    align-items: flex-start;
    padding-top: 80px;
    -webkit-transform: scale(0);
    -ms-transform: scale(0);
    transform: scale(0);
    -webkit-transition: -webkit-transform 100ms ease-in-out;
    transition: -webkit-transform 100ms ease-in-out;
    -o-transition: transform 100ms ease-in-out;
    transition: transform 100ms ease-in-out;
    transition: transform 100ms ease-in-out, -webkit-transform 100ms ease-in-out;
  }

  .navigation-list a {
    font-size: 16px;
  }
  .numbers {
    display: inline;
    margin-right: 2vw;
  }
  .section-home {
    width: 87.2vw;
    margin: 15.8vw auto 30vh auto;
    padding-bottom: 2vh;
  }
  h1 {
    text-align: center;
    line-height: 1.2;
  }

  h5 {
    letter-spacing: 2.7px;
  }

  h5,
  p {
    font-size: 4.1vw;
  }
  a.explore-btn {
    width: 40vw;
    height: 40vw;
    margin: 0 auto;
  }
}
